//var edit scenario current
var valuesEditFormCurrent;

//var edit scenario changed
var valuesEditFormChanged;

//run saved scenario
$(document).ready(function () {

    // variable is undefined
    if (typeof run_scenario !== 'undefined') {

        $.each(run_scenario, function(key, value){
            //set values for key founds in form
            if(key != 'datasetId' && key != 'dataset' && key != 'provider' ) {
                $( "[name*='" +key+ "']" ).val(value);
            }
        });
        
        //choose select for new scenario form
        //$(".chosen-select").chosen();
        $(".chosen-select").select2();
        
        //input range for new scenario form
        $(".input-range").ionRangeSlider({
          type : 'double'
        });

        updateIndicatorWeight();

        $('.check-group-runScenario').each(function (index, value) {
            if ( $(this).is(':checked') ) {
                $(this).trigger( "click" );
                $(this).trigger( "click" );
            } 
        });

        //trigger inputs weight
        $('.new-scenario-weight').trigger('onchange');

        //trigger inputs group weight
        $('.new-scenario-weight-group').trigger('onchange');

        //set current form values to var valuesEditFormCurrent 
        valuesEditFormCurrent = JSON.stringify( $( '#runScenarioForm input[name!="favorite"]').serializeObject() );

        $('#runScenarioForm').submit();

    }
});


//send new scenario
$("#runScenarioForm").submit(function (event) {
    
    //no submit form
    event.preventDefault();

    // //empty header table results
    $('#table-results #thead-results tr').html('');
    // //empty body table results
    $('#table-results #tbody-results').html('');

    //flag for run
    var itCanRun = true;

    //check all subgroup items
    $.each( subgroupActives, function(index, item){
        if (item.sum != 100 ) {
            itCanRun = false;
        }
    });

    //check if can send form
    if (itCanRun == true) {
        //hide link to tab results
        //$('#link-tab-results').hide();

        var form = this;
        //check if valuesEditChanged is equal to valuesEditFormCurrent
        valuesEditFormChanged = JSON.stringify($('#runScenarioForm').serializeObject() );
        

		sendRunScenarioForm(form, false);        
		
    } else {
        Lobibox.alert('warning', {
            msg: "Alert: Please adjust weighting items! One or more criterion that were previously utilized in this scenario are no longer part of the updated version of this dataset. Please reallocate weights to total 100% before running the scenario."
        });
    }
});


//send editScenarioForm
function sendRunScenarioForm (form, save) {
	
	function isValidJson(json) {
	    try {
	        JSON.parse(json);
	        return true;
	    } catch (e) {
	        return false;
	    }
	}
	
	
    //flag for run
    var itCanRun = true;

    //check all subgroup items
    $.each( subgroupActives, function(index, item){

        if (item.sum != 100 ) {
            itCanRun = false;
        }

    } );

    //check if can send form
    if (itCanRun == true) { 

        //hide link to tab results
        $('#link-tab-results').hide();
       
        // //empty header table results
        $('#table-results #thead-results tr').html('');

        // //empty body table results
        $('#table-results #tbody-results').html('');


        var dataValues = $( form ).serialize(); 
        //delete last aquote and set to stringValues 
        var stringValues = (String) ( JSON.stringify(dataValues).slice(0, -1) ) ;

         $.ajax({
            type: "POST",
            url: urlRProcess2,
            data: stringValues,
            processData: false,
            contentType: 'application/x-www-form-urlencoded; charset=UTF-8',
            crossDomain : true,
            success: function (dataResponse) {
                
				if (isValidJson(dataResponse)) {

	                //for new url server with number results
	                var resultsFav = JSON.parse(dataResponse);
	                
	                if (typeof resultsFav.totalResult == 'undefined') {
	                    var data = JSON.parse('{}');
	                    var numResults = 0;
	                } else {
	                    var data = resultsFav.results;
	                    var numResults = resultsFav.totalResult;
	                }
	            } else {

					var data = [{name:'name'}];
					var numResults = 0;
	                var resultsFav = null;		            
		            
	            }

                if (save == true) {
                    request_progress.setProgress(100);
                    request_progress.destroy();
                    saveScenarioFromFormRunScenario(form);
                }

                resultsForScenario = data;
              
				$("html, body").animate({ scrollTop: 0 }, "slow");
				$('#link-tab-results').css({display:'block'});

                //show link to tab results
//              $('#link-tab-results').show('slow');

                //show tab with results
//              $('#link-tab-results').tab('show');

                //number header
                var numHeaders = 0;
                //recorre response
                $.each( data, function( index, value ){
	                
	                
                    //check if is titles
                    if(index === 0) {
                        //append to tr header favoites and decidere score
                        $('#table-results #thead-results tr').append('<th> Favorites </th> <th>Decidere Score</th>');
                        numHeaders++;

                        //extract key values from object
                        $.each(value, function(key, valueb){
                            //append to tr header each key value
                            numHeaders++;
                            $('#table-results #thead-results tr').append('<th> ' + valueb.replaceAll('_', ' ') + ' </th> ');
                        });
                    } else {

                        var numTds = 0;

                        //create new 'tr'
                        var tr = $("<tr class='animated flipInX' ></tr>");

                        //append 'td' with 'checkbox' in 'tr'
                        $( tr ).append('<td> <input type="checkbox" class="checkbox-favorite" name="favorite" value=" ' + index + ' " > </td>');
                        numTds++;

                        //extract key values from object
                        $.each(value, function(key, valueb){
                            //append one 'td' for each key value in object
                            $( tr ).append('<td> ' + valueb + ' </td> ');
                            numTds++;
                        });

                        //equal td to th
                        for (var i = numTds; i <= numHeaders; i++) {
                            $( tr ).append('<td>  </td> ');
                        };

                        //append 'tr' in tbody
                        $('#table-results #tbody-results').append( $( tr ) );
                    }
                    return;
                });

                //Add functionallity to export
                // $("#table-results").tableExport({
                //     headings: true,                    // (Boolean), display table headings (th elements) in the first row
                //     formats: ["xlsx", "csv", "txt"],    // (String[]), filetypes for the export
                //     bootstrap: true,                   // (Boolean), style buttons using bootstrap
                //     position: "top"  
                // });



                var objDate = new Date(),
                locale = "en-us",
                currentMonth = objDate.toLocaleString(locale, { month: "long" });
                currentYear = objDate.getFullYear();
                $('#table-results').DataTable( {
                    "paging":   true,
                    "pageLength": 50,
                    "ordering": false,
                    "info":     false,
                    "searching":true,
					"bDestroy": true,
                    dom: 'Bfrtip',
                    buttons: [
                        {
                            extend: 'pdfHtml5',
                            exportOptions: {
                                    columns: [ 1, 2, 3, 4 ]
                            },
                            title: 'Results Report',
                            filename: $("#name-scenario-edit").html(),
                            customize: function ( doc ) {

                                doc.defaultStyle.fontSize = 8;
                                
								doc.styles.tableHeader = {
									alignment:"left",
									bold:true,
									color:"white",
									fillColor:"#2d4154",
									fontSize:9,
									margin:[2,0,0,0]
								   };
								   
								doc.styles.tableBodyOdd = {
										margin:[2,0,0,0]
									};   	                            

								doc.styles.tableBodyEven = {
										margin:[2,0,0,0]
									};   	                            
                                
                                var cols = [];
                                cols[0] = {text: 'Secnario Name: ' + $("#name-scenario-edit").html() + '\n' + 'Save Date: ' + currentMonth + ' ' + currentYear, fontSize : 10, alignment: 'left', margin:[40,15,40,40] };
                                cols[1] = {text: $(".a-login").html(), alignment: 'right', fontSize : 10, margin:[0,15,40,40] };
                                var objHeader = {};
                                objHeader['columns'] = cols;
                                doc['header']= objHeader;
                                doc.content[1].table.widths = [ '*', '*', '*', '*'];
                                doc.content.splice( 0, 0, {
                                    margin: [ 20, 20, 20, 20],
                                    alignment: 'center',
                                    image: 'data:image/png;base64,',
                                    fit: [200, 50],
                                } );
                            },

                        },
                        'csv', 
                        'excel', 
                        'print'
                    ]
                } );


                
				if (numResults > 250) {
	                var msgText = ['<div class="caption">Displaying the top 250 results from a total of ',numResults,'.</div>'].join('');
				} else {
    	            var msgText = ['<div class="caption">This scenario yielded a total of ',numResults,' results.</div>'].join('');
				}                     
                $('.dt-buttons').append(msgText)                
                
/*
                Lobibox.notify('success', {
                    msg: 'Your preferences obtained ' + numResults + ' results.',
                });
*/

                var cookieValue = $.cookie("notShowRunScenarioMessageAgain");
                if(cookieValue == undefined){
                    $('#runScenarioModal').modal('show');
                }
            }, 
            error: function (err){;
	            
	            console.log("Error: ",err);
	            
                Lobibox.alert('warning', {
                    msg: "Alert 3: Please adjust weighting items! One or more criterion that were previously utilized in this scenario are no longer part of the updated version of this dataset. Please reallocate weights to total 100% before running the scenario."
                });
            },

            beforeSend: function () {
                request_progress = Lobibox.progress({
                    title: 'Please wait',
                    label: 'Get results...'
                });
                request_progress.setProgress(50);
            },
            complete: function () {
                request_progress.setProgress(100);
                request_progress.destroy();

            }
        });

    } else {
        Lobibox.alert('error', {
            msg: "Something went wrong please check that the form is properly filled"
        });
    }
    
    
}

$('#btnRunScenarioMessage').click(function(event){
    var checked = $('#runScenarioConfirmCheckbox').is(":checked");
    if(checked){
        $.cookie('notShowRunScenarioMessageAgain', 'true', { expires: 30 });  //This cookie will expires in 30 days.
    }
});


//save as run scenario
function saveScenarioFromFormRunScenario(form) {

    //empty #scenario_val
    $('#runScenarioForm #scenario_val').val('');
    
    //scenario form parsed
    var scenarioValues = JSON.stringify( $( '#' + form.id +' input[name!="favorite"]').serializeObject() );
    
    //set form parset value to #scenario_val
    $('#runScenarioForm #scenario_val').val(  scenarioValues  );

    //serialize form
    var dataValues = new FormData ( form ) ;

    //empty #scenario_val
    $('#runScenarioForm #scenario_val').val('');

    $.ajax({
        type: "POST",
        url: form.action,
        data: dataValues,
        processData: false,
        contentType: false,
        dataType: "json",
        success: function (data) {
            scenarioSavedId = data.response.response.id;
            Lobibox.notify('success', {
                msg: 'Save Scenario.'
            });
        }, 
        error: function (data){
            console.log(data);
        },

        beforeSend: function () {
            request_progress = Lobibox.progress({
                title: 'Please wait',
                label: 'Saving scenario...'
            });
            request_progress.setProgress(50);
        },
        complete: function () {
            request_progress.setProgress(100);
            request_progress.destroy();
        }
    });
}